import React ,{useState, Fragment} from 'react';
import {useForm} from 'react-hook-form';
import {Col,Button,Form,Label,Input,FormGroup,InputGroup,InputGroupAddon,InputGroupText} from 'reactstrap';
import {FirstName,LastName,Username,State,City,Zip,SubmitForm} from '../../../../../../../constant';
import "./styles.css";

const PageOneMainHelper = (props) => {

    const { register, handleSubmit, formState: { errors }} = useForm();
    const [validateClass , setValidateClass] = useState(false);
    const [ data, setData ] = useState({});


    const onSubmit = (e, data) => {

        e.preventDefault();

        if (data !== '') {
            alert('You submitted the form and stuff!');
        } else {
            errors.showMessages();
        }
    };
    handleInputChange = (e) => {
        const { name, value } = e.target;

        setData(prevState => {
            return {
                ...prevState,
                [name]: value
            }
        })
    };
    console.log("data", data);
    return (
        <div>
            <Form className={`needs-validation tooltip-validation ${validateClass ? 'validateClass' : ''}`} noValidate="" onSubmit={handleSubmit(onSubmit)}>
                <div className="form-row">
                <Col md="6 mb-3">
                    <Label>Listing Title (Be As Specific As Possible)</Label>
                    <Input onChange={this.handleInputChange} className="form-control" name="listingTitle" type="text" placeholder="Listing title" {...register(("listingTitle"), { required: true })} />
                    <span>{errors.listingTitle && 'Listing title is required'}</span>
                    <div className="valid-feedback">{"Looks good!"}</div>
                </Col>
                <Col md="6 mb-3">
                    <Label>{LastName}</Label>
                    <Input onChange={this.handleInputChange} className="form-control"  name="lastName" type="text" placeholder="Last name" {...register(("testing"), { required: true })} />
                    <span>{errors.lastName && 'Last name is required'}</span>
                    <div className="valid-feedback">{"Looks good!"}</div>
                </Col>
                {/* <Col md="4 mb-3">
                    <Label>{Username}</Label>
                    <InputGroup>
                    <InputGroupAddon addonType="prepend">
                        <InputGroupText >{"@"}</InputGroupText>
                        </InputGroupAddon>
                    <Input className="form-control"  name="userName" type="text" placeholder="Username" aria-describedby="inputGroupPrepend" {...register(("testing"), { required: true })} />
                    <span>{errors.lastName && 'User name is required'}</span>
                    <div className="invalid-feedback">{"Please choose a username."}</div>
                    </InputGroup>
                </Col> */}
                </div>
                <div className="form-row">
                <Col md="6 mb-3">
                    <Label>{City}</Label>
                    <Input onChange={this.handleInputChange} className="form-control"  name="city" type="text" placeholder="City" {...register(("testing"), { required: true })} />
                    <span>{errors.city && 'Please provide a valid city'}</span>
                    <div className="invalid-feedback">{"Please provide a valid city."}</div>
                </Col>
                <Col md="3 mb-3">
                    <Label>{State}</Label>
                    <Input onChange={this.handleInputChange} className="form-control"  name="state" type="text" placeholder="State" {...register(("testing"), { required: true })} />
                    <span>{errors.state && 'Please provide a valid state.'}</span>
                    <div className="invalid-feedback">{"Please provide a valid state."}</div>
                </Col>
                <Col md="3 mb-3">
                    <Label>{Zip}</Label>
                    <Input onChange={this.handleInputChange} className="form-control"  name="zip" type="text" placeholder="Zip" {...register(("testing"), { required: true })} />
                    <span>{errors.zip && 'Please provide a valid zip.'}</span>
                    <div className="invalid-feedback">{"Please provide a valid zip."}</div>
                </Col>
                </div>
                <FormGroup>
                <div className="form-check">
                    <div className="checkbox p-0">
                    <Input onChange={this.handleInputChange} className="form-check-input" id="invalidCheck3" type="checkbox" />
                    <Label className="form-check-label" htmlFor="invalidCheck3">{"Agree to terms and conditions"}</Label>
                    </div>
                </div>
                </FormGroup>
                <Button color="primary"  type="submit" onClick={() => setValidateClass(!validateClass)}>{SubmitForm}</Button>
            </Form>
        </div>
    );
}

export default PageOneMainHelper;
